import React from "react";
import makeStyles from "@mui/styles/makeStyles";

const useStyles = makeStyles({
  page: {
    background: "#f9f9f9",
    width: "100%",
  },
});

export default function Layout({ children }) {
  const classes = useStyles();
  return (
    <div>
      <div className={classes.page}>{children}</div>
    </div>
  );
}
